import React from "react";

class SensorInfo extends React.Component {
  render() {

      // Deconstruct props.
      const {info} = this.props;

      return (
          <div style={{paddingTop: "15px", textAlign: "left"}}>
              <div><b>{info.type}</b></div>
              <div>
                  <div>Status: <b style={{color: '#55BB55'}}>Live</b></div>
                  <div style={{cursor: 'pointer'}}><u>More Details</u></div>
              </div>
          </div>
      );
  }
}

export default SensorInfo;
